import React, { useState, useEffect } from 'react';
import '../App.css';
import api from '../api';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import { Button } from '@material-ui/core';
import TextField from '@material-ui/core/TextField';

const defaultValues = {
    name: "",
    surname: "",
    email: "",
    city: "",
    shipping: "",
    socType: "",
    socValue: "",
    paid: false,
    sent: false,
    products: "",
    price: "",
};

export function Order() {
    const [formValues, setFormValues] = useState();

    function loadCart() {
        const stored = JSON.parse(localStorage.getItem('podarok-print-en'));
        console.log(stored);

    }

    const handleInputChange = (e) => {
        const { name, value } = e.target;
        setFormValues({
            ...formValues,
            [name]: value,
        });
    };


    useEffect(() => {
        loadCart();
    }, []);

    return (
        <div>
            <Grid container alignItems="center" justify="center" direction="column">
                <Grid item>
                    <TextField
                        id="name-input"
                        name="name"
                        label="Имя"
                        type="text"
                        value={formValues.name}
                        onChange={handleInputChange}
                        required={true}
                        fullWidth={true}
                    />
                </Grid>
                <Grid item>
                    <TextField
                        id="surname-input"
                        name="surname"
                        label="Фамилия"
                        type="text"
                        value={formValues.surname}
                        onChange={handleInputChange}
                        required={true}
                    />
                </Grid>
                <Grid item>
                    <TextField
                        id="city-input"
                        name="city"
                        label="Город"
                        type="text"
                        value={formValues.city}
                        onChange={handleInputChange}
                        required={true}
                    />
                </Grid>
                <Grid item>
                    <TextField
                        id="shipping-address"
                        name="shipping"
                        label="Отделение НП"
                        type="text"
                        value={formValues.shipping}
                        onChange={handleInputChange}
                        required={true}
                    />
                </Grid>
                <Grid item>
                    <TextField
                        id="email-input"
                        name="email"
                        label="Email"
                        type="email"
                        value={formValues.email}
                        onChange={handleInputChange}
                        required={true}
                    />
                </Grid>
                <Grid item>
                    <TextField
                        id="price-input"
                        name="price"
                        type="number"
                        hidden={true}
                        value={formValues.price}
                        // onChange={handleInputChange}
                        required={true}
                        disabled={true}
                    />
                </Grid>
                <Grid item>
                    <TextField
                        id="products-input"
                        name="products"
                        type="text"
                        hidden={true}
                        value={formValues.products}
                        // onChange={handleInputChange}
                        required={true}
                        disabled={true}
                    />
                </Grid>
            </Grid>
        </div>
    )
}
